import React from 'react';
const SlotM=(props)=>{
    // let x='😂';
    // let y='😂';
    // let z='😂';
let x=props.x;
let y=props.y;
let z=props.z;
    if((x==y) && (y==z)){
        return(
            <>
                <div className="slot_inner">
                     <h1> {x} {y} {z}</h1>
                    <h1>This is Matching</h1>
                    <hr/>
                </div>
            </>
        );
    }else{
        return(
            <>
                <div className="slot_inner">
                     <h1> {x} {y} {z}</h1>
                    <h1>This is not Matching</h1>
                    <hr/>
                </div>
            </>
        );

    }
};
const App=()=>{
return<>
    <h1 className='heading_style'>👌Welcome to <span style={{fontweight: "bold"}}>Slot Machine Game 👌</span> {" "}</h1>
    <h2></h2>
    <div className='slotmachine'>
    <SlotM x='😊' y='😊' z='😊'/>.
    <hr/>
    <SlotM x='😘' y='😘' z='😘'/>
    <hr/>
    <SlotM x='💕' y='💕' z='💕'/>
    <hr/>
    <SlotM x='👍' y='👍' z='👍'/>
    <hr/>
    </div>
    
 </>
}
export default App;
